						<div itemprop="articleBody">
		<p>På bestyrelsesmødet den 5. januar 2010, hvor samtlige bestyrelsesmedlemmer var tilstede, hilste man den nye hjemmeside velkommen og drøftede dens videre indhold. Man besluttede, at indlæg på hjemmesiden underskrives af forfatteren. Vi vil forsøge at få udsendt meddelelse til vore medlemmer om hjemmesidens eksistens sammen med indkaldelse til Generalforsamlingen. Denne finder sted den 28. april formentlig på Gentofte Hospital. Alternative mugliheder undersøges. Forud for Generalforsamlingen vil Sajida Afzal fortælle om sit nye virke. Meddelelsen om Agnethe Løvgreens Legat er sendt til Ugeskriftet og Mok. Legatansøgninger sendes til formanden og vurderes herefter af Tina Engell og Kirsten Salado-Rasmussen. Næste bestyrelsesmøde er berammet til den 25. februar kl. 18.30 hos Margrethe Foss Hansen.</p>
<p>Agnete Basbøll</p>	</div>

	
